import React from 'react';
import { Link } from 'react-router-dom';

function Navigation() {
  return (
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li>
          <Link to="/features">Features</Link>
          <ul className="dropdown">
            <li><Link to="/features/page1">Page 1</Link></li>
            <li><Link to="/features/page2">Page 2</Link></li>
            <li><Link to="/features/page3">Page 3</Link></li>
            <li><Link to="/features/page4">Page 4</Link></li>
            <li><Link to="/features/page5">Page 5</Link></li>
            <li><Link to="/features/page6">Page 6</Link></li>
          </ul>
        </li>
        <li><Link to="/about">About</Link></li>
        <li><Link to="/contact">Contact</Link></li>
      </ul>
    </nav>
  );
}

export default Navigation;
